Representar un personaje como la Dama de Negro en esta nueva versión de la icónica serie de los 80 "La Hora Marcada"  además de haber sido un reto, fue una gran responsabilidad, teniendo en cuenta que esta es una serie de culto entre los amantes del suspenso y el terror, y que en su época marcó a toda una generación. 

Agradecida por la oportunidad y esperando que esta personificación de La Dama de Negro sea del agrado de todos, los invito a ver esta serie que en su nueva version cuenta con la actuación y dirección de grandes exponentes de la industria.

Para un actor, trabajar en un proyecto de la mano de @vix  @wstudiosoficial @televisa @univision es un lujo y un plus en su carrera, estas son de las industrias de contenido mas prolíficas e importantes.

A los que estuvieron involucrados en su conceptualizacion y creación, mis más sinceras felicitaciones porque el resultado en pantalla es realmente impactante...GRACIAS ✨✨✨

